import { Fragment } from 'react'
import { Disclosure, Menu, Transition } from '@headlessui/react'
import { Bars3Icon, BellIcon, XMarkIcon } from '@heroicons/react/24/outline'
import SignatureWhite from '../Assets/Signature White.png';
import Expériences from '../Pages/Expériences/Expériences'
import Hackatons from '../Pages/Hackathons/Hackathons'
import Home from '../Pages/Home/Home'
import Parcours from '../Pages/Parcours/Parcours'
import Projects from '../Pages/Projets/Projets'
import Technologies from '../Pages/Technologies/Technologies'
import { useState } from 'react';


const navigation = [
    { name: 'Home', href: '/Home', current: false },
    { name: 'Parcours', href: '/Parcours', current: false },
    { name: 'Technologies', href: '/Technologies', current: false },
    { name: 'Projets', href: '/Projets', current: false },
    { name: 'Hackathons', href: '/Hackathons', current: false },
    { name: 'Expériences', href: '/Expériences', current: false },
]

function classNames(...classes) {
  return classes.filter(Boolean).join(' ')
}

export default function App() {
  const [currentPage, setCurrentPage] = useState('/Home');

  const handleClick = (href) => {
    setCurrentPage(href);
  };

  return <NavBar navigation={navigation} currentPage={currentPage} onNavClick={handleClick} />;
}

export function NavBar() {
  return (
    <Disclosure as="nav" className="bg-gray-800">
      {({ open }) => (
        <>
          <div className="mx-auto max-w-7xl px-2 sm:px-6 lg:px-8">
            <div className="relative flex h-16 items-center justify-between">
              <div className="absolute inset-y-0 left-0 flex items-center sm:hidden">
                {/* Mobile menu button*/}
                <Disclosure.Button className="relative inline-flex items-center justify-center rounded-md p-2 text-gray-400 hover:bg-gray-700 hover:text-white focus:outline-none focus:ring-2 focus:ring-inset focus:ring-white">
                  <span className="absolute -inset-0.5" />
                  <span className="sr-only">Open main menu</span>
                  {open ? (
                    <XMarkIcon className="block h-6 w-6" aria-hidden="true" />
                  ) : (
                    <Bars3Icon className="block h-6 w-6" aria-hidden="true" />
                  )}
                </Disclosure.Button>
              </div>
              <div className="flex flex-1 items-center justify-center sm:items-stretch sm:justify-start">
                <div className="flex flex-shrink-0 items-center">
                  { <img
                    className="h-8 w-auto"
                    src={SignatureWhite}
                    alt="Your Company"
                  /> 
                  }
                </div>
                <div className="hidden sm:ml-6 sm:block">
                  <div className="flex space-x-4">
                  {navigation.map((item) => (
                <a
                  key={item.name}
                  href={item.href}
                  onClick={() => onNavClick(item.href)}
                  className={classNames(
                    currentPage === item.href ? 'bg-gray-900 text-white' : 'text-gray-300 hover:bg-gray-700 hover:text-white',
                    'rounded-md px-3 py-2 text-sm font-medium'
                  )}
                  aria-current={currentPage === item.href ? 'page' : undefined}
                >
                  {item.name}
                </a>
              ))}
